void test_image() {
	// draw GDP test image
	gdp_draw(gfx_ti, 255, 0, 0);
	// display AVDC test pattern
	avdc_write_str_at_pointer_pos(0, 0, "EEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEE", 0);
	avdc_write_str_at_pointer_pos(25, 0, "EEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEE", 0);
	for (int row = 1; row < 25; row++) {
		avdc_write_str_at_pointer_pos(row, 0, "EE", 0);
		avdc_write_str_at_pointer_pos(row, 80 - 2, "EE", 0);
	}
	while (!kbhit());
	avdc_clear_screen();
	gdp_cls();	
}

void bios_init() {
	avdc_write_str_at_pointer_pos(0, 0, "Inicializiram BIOS...", 0);
	BIOS_A8 = 0xf0;
	BIOS_A9 = 0x95;
	BIOS_AA = 0xff;
	BIOS_AB = 0x01;
	BIOS_AC = 0x51;
	BIOS_AD = 0x07;
	BIOS_AE = 0x02;
	BIOS_AF = 0x57;
	avdc_write_str_at_pointer_pos(1, 0, "Inicializacija koncana. Racunalnik je potrebno ponovno zagnati.", 0);
	avdc_write_str_at_pointer_pos(2, 0, "Pritisni neko tipko za nadaljevanje.", 0);
	while (!kbhit());
	avdc_clear_screen();
}

void main() {
	avdc_init();
	gdp_init();

	bool end_program = FALSE;

	while (true) {
		avdc_write_str_at_pointer_pos(0, 0, "1 - Testna slika", 0);
		avdc_write_str_at_pointer_pos(1, 0, "2 - Inicializacija BIOSA", 0);
		avdc_write_str_at_pointer_pos(2, 0, "X - Izhod iz programa", 0);

		char key;
		while (!(key = kbhit()));
		switch (key) {
			case '1':
				avdc_clear_screen();
				test_image();
				break;
			case '2':
				avdc_clear_screen();
				bios_init();
				break;
			case 'X':
			case 'x':
				end_program = TRUE;
				break;
		}

		if (end_program) { break; }
	}

	gdp_done();
	avdc_done();
}